import ReactDOM from 'react-dom';
import './dashboardPage.css';
import Avatar from 'react-avatar-edit';
import {storage} from '../../Firebase';

const React = require('react');


export default class SurveyFields extends React.Component {

    constructor(props) {
        super(props);
        const src = "";
        this.state = {
            preview: null,
            src,
            avatar: null,
            avatarDefault: 'https://firebasestorage.googleapis.com/v0/b/vue-elbrus-crm.appspot.com/o/avatar%2Fpetr.jpg?alt=media&token=baf9556b-863b-484c-b001-3196a0825583',
            previewDefault: 'data:image/png;base64,'
        };
        this.onCrop = this.onCrop.bind(this);
        this.onClose = this.onClose.bind(this);
        this.onBeforeFileLoad = this.onBeforeFileLoad.bind(this);
        this.lastStep = this.lastStep.bind(this);
        this.stepBy = this.stepBy.bind(this);
    }

    onClose() {
        this.setState({preview: null})
    }

    onCrop(preview) {
        this.setState({preview})
    }

    onBeforeFileLoad(elem) {
        if (elem.target.files[0].size > 71680) {
            alert("File is too big!");
            elem.target.value = "";
        } else {
            const preview = elem.target.files[0];
            this.setState(() => ({src: preview}));
        }
    }

    async lastStep() {
        if (this.state.preview === null) {
            this.setState({
                preview: this.state.previewDefault,
                src: {name: 'default'}
                // avatar: this.state.avatarDefault
            })
            await this.stepBy(this.state.previewDefault, 'default');
            return this.props.nextStep(this.state);
        }
        await this.stepBy();
        // this.props.changeInfo(this.state);
        this.props.nextStep(this.state);
    }


    async stepBy(preview, name) {
        const response = await fetch(preview || this.state.preview);
        const blob = await response.blob();
        const uploadTask = storage.ref(`avatar/${name || this.state.src.name}`).put(blob);
        console.log(blob);
        return new Promise(resolve => {
            uploadTask.on('state_changed',
                (snapshot) => {
                    // progrss function ....
                    // const progress = Math.round((snapshot.bytesTransferred / snapshot.totalBytes) * 100);
                    // this.setState({ progress });
                    console.log(snapshot)
                },
                (error) => {
                    // error function ....
                    console.log(error);
                },
                () => {
                    // complete function ....
                    storage.ref('avatar').child(name || this.state.src.name).getDownloadURL().then(url => {
                        this.setState({avatar: url});
                        resolve()
                    })
                });
        })
    }

    render() {

        return (
            <div className="form">
                <h2 id="fullName">Choose Avatar</h2>
                <div id="login">
                    <Avatar style={{
                        border: "2px",
                        dashed: "rgb(151, 151, 151)",
                        borderRadius: "8px",
                        textAlign: "center",
                        width: "90%",
                        height: "90%"
                    }}
                            width={350}
                            height={295}
                            onCrop={this.onCrop}
                            onClose={this.onClose}
                            onBeforeFileLoad={this.onBeforeFileLoad}
                            src={this.state.preview}
                    />
                    <h6 className="choose" id="email"  style={{gridRowStart: '5'}}>You can skip this step</h6>
                </div>
                <div id="buttons">
                    <button className="firstButtAvatar" onClick={this.props.previousStep}>Back</button>
                    <button className="secondButt" onClick={this.lastStep}>Save &amp;
                        Continue
                    </button>
                </div>
            </div>
        )
    }

}
